<p class="MsoNormal"><span lang="ES-TRAD">SUI GENERIS es el título de una serie de audios, a modo de programa de radio, realizado por el alumnado de Griego, Latín y Mitología y las Artes del Instituto. Como se refleja en la introducción al programa, tratamos de acerca la civilización grecorromana a nuestros días. El programa consta de cuatro secciones: la música, la mitología y Pablo Alborán; Hipatia de Alejandría: la primera matemática; el mundo de los muertos en la antigua Roma y curiosidades mitológicas. Un saludo desde La Palma</span></p>
&nbsp;

&nbsp;
<p class="MsoNormal"><span lang="ES-TRAD">El Departamento de Filosofía celebra el Día de la Filosofía el 16 de noviembre. Esta fecha fue propuesta por la UNESCO, pues la filosofía, según esta organización, fundamenta los valores de los que depende la paz mundial: democracia, Derechos Humanos, justicia e igualdad. Esta celebración se realiza desde el 2005 y se alienta a que participen distintos colectivos. Nosotros hemos realizado, además de esta actividad, una exposición de libros, fotografías de alumnos en actividades filosóficas y, especialmente, trabajos del alumnado</span></p>
